import './DoctorLogin.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorLogin() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const[username, setUsername] = useState("");
    const[password, setPassword] = useState("");
    const navigate = useNavigate();

    // Handle choice between sign up and sign in
    const handleChoice = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }

    // Handle sign in 
    const handleSignIn = () => {

    }

    return (
        <div className="login-container">
            <h1>Doctor</h1>

            {!signIn && !signUp ? (
                <div className="account-container">
                    <button className="account-button" onClick={() => handleChoice("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleChoice("sign up")}>Create An Account</button>
                </div>
            ): null}

            {signIn ? (
                <div>
                    <h2>Sign In</h2>
                    <form>
                        <label>Username:</label>
                            <input 
                                type="text"
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                            />
                        <label>Password:</label>
                            <input 
                                type="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}/>
                        <button onClick={handleSignIn} type="submit">Sign In</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

            {signUp ? (
                <div> 
                    <h2>Sign Up</h2>
                    <form className="sign-up-form">
                        <div>
                            <label>Name:</label>
                            <input type="text"/>
                        </div>
                        <div>
                            <label>Email:</label>
                            <input type="email"/>
                        </div>
                        <div>
                            <label>Password:</label>
                                <input type="password"/>
                                </div>
                        <label>Date of Birth:</label>
                            <input 
                                type="dob"
                            />
                        <label>Gender:</label>
                            <input 
                                type="text"
                            />
                        <label>Phone:</label>
                            <input 
                                type="tel"
                            />
                    </form>
                    <button onClick={() => setSignUp(false)}>Back</button>
                </div>
            ) : null}
        </div>
    )
}
